(13, 17, 53, 0, 'Помощь для новичков:\r\nНик (от англ. Nick) - игровое имя игрока\r\n\r\nАдминистратор (лат. administrator — управитель) — распорядитель в учреждении, коллективе, а также специалист по обслуживанию баз данных и информационных систем. В Общероссийском классификаторе занятий (ОКЗ) администратор считается должностью.\r\n\r\nМодера?тор (от лат. moderor — умеряю, сдерживаю) — пользователь, имеющий более широкие права по сравнению с обыкновенными пользователями на общественных сетевых ресурсах (чатах, форумах, эхоконференциях), в частности хотя бы одно из прав:\r\n- право удалять чужие сообщения\r\n- право редактировать чужие сообщения\r\n- право редактировать игровой форум\r\n- ограничивать пользователей в правах редактирования и просмотра сайта (банить).\r\n\r\nТочный перечень полномочий и обязанностей модератора на каждом сайте свой. Чаще всего модератор отвечает за соблюдение пользователями правил сайта.\r\n\r\nБан (от англ. Ban) Английское слово ban означает «запрет». Бан — это перекрытие администратором (модератором) доступа какому-либо участнику форума (чата). Бан может быть как на создание новых тем, комментариев, отправления личных сообщений, так и на чтение форума (чата) вообще. От слова «бан» образовался глагол «бАнить» — перекрывать доступ. Пример: «будешь материться — забаню по IP!». Бан по IP означает запрет доступа с того IP-адреса, с которого нарушитель зашел на форум.\r\n\r\nF.A.Q., ЧАВО, ЧаВо, ЧаВО, ЧЗВ, ФАК, FAQ, (акроним от англ. Frequently Asked Question(s) — часто задаваемые вопросы, произносится , «фак», «фэк», «фэкс», «эф-эй-кью») — собрание часто задаваемых вопросов по какой-либо теме и ответов на них.\r\n\r\nКапс (от англ. Caps) - это то, когда кто-то в чате пишет заглавными буквами. Нарушение правил\r\n\r\nФлуд (от англ. Flood) Английское слово flood означает «поток». Флуд — это создание многочисленных бессмысленных комментариев или тем, с целью засорить форум. Флуд зачастую карается баном. Человека, который пишет много чепухи на форум, называют «флудер» или «флудист». Глагол «флудИть» означает «писать флуд». Нарушение правил\r\nОффтоп Английское выражение Off-topic означает «не по теме». Любое сетевое сообщение, выходящее за рамки заранее установленной темы общения. Нарушение правил\r\n\r\nФлейм Английское слово flame означает «пламя» или в переносном смысле «жаркий спор», зачастую с применением взаимных оскорблений. Нарушение правил\r\n\r\nТроллинг, тролль — человек, который «достаёт» оппонента хитрыми действиями или едкими высказываниями с целью разозлить собеседника и вызвать конфликт. По-русски говоря — провокатор. Троллинг — сам процесс провокации. «ТрОллить» можно не только в интернете, но и в реале, доставая и раздражая кого-либо из своих друзей или родственников. Нарушение правил\r\n\r\n\r\nНекропостинг сообщение в давно забытую тему форума, которая остается без продолжения (ответов) в течение длительного времени сообщениями «Ап» , «А тут дело говорили» и т. д. переносящее топик на первую страницу. Нарушение правил\r\n\r\nМультиакк, мультиаккаунт, мультиводство (от англ. Multiaccount) - создание одним игроков несколько игровых аккаунтов, с целью получения игрового преимущества и/или увеличения благосостояния иных своих игровых персонажей или игровых персонажей третьих лиц, а также в корыстных целях для обхода бана и оскорблений. Нарушение правил\r\n\r\nБот (англ. bot) — в интернет-проектах и сервисах, специальная программа, запускаемая участником проекта или сервиса, имитирующая деятельность учетной записи, а также сама эта учетная запись. Обычно используется для различных технических нужд — повышения удобства остальных пользователей, совершения однотипных операций и т. п., и другим участникам известно, что учетная запись используется ботом. Если используется игроком нарушение правил\r\n\r\nЧитерство (от англ. to cheat — мошенничать) — жаргонный термин, применяемый преимущественно в контексте игр, чаще компьютерных или азартных. Означает применение недозволенных или нестандартных методов и приёмов, а также специальных технических средств для повышения эффективности игровых действий или облегчения игры. Нарушение правил\r\n\r\nК.О. - сокращённо «клановый опыт». Его не нужно собирать отдельно. Просто это определённый процент от Вашего личного опыта. Чем больше личного опыта Вы получаете - тем больше Ваш показатель К.О. Его можно посмотреть, зайдя в клан и посмотрев цифры в скобках после Вашего ника на главной странице клана или зайдя в казну клана и выбрав «Статистика пополнений» -» вкладка «Опыт» (если нужно посмотреть к.о. за определённый период).\r\n\r\nBB-Code (аббр. от англ. Bulletin Board Code) — язык разметки, используемый для форматирования сообщений на многих электронных досках объявлений (BBS) и форумах. Для форматирования текста используются теги, подобные тегам HTML, но, в отличие от них, заключённые в квадратные скобки. Перед отображением страницы движок форума производит разбор текста и преобразование его в HTML-код.\r\n\r\nИмхо IMHO (In My Humble Opinion) означает «по моему скромному мнению». Иногда ИМХО расшифровывают на русский лад: «Имею Мнение, Хочу Озвучить». В сетевых диалогах ИМХО заменяет обычное «по-моему».\r\n\r\nЛол Английская аббревиатура LOL (Laughing Out Loud) означает «громко смеюсь». На русский она почему-то не перевелась в виде «ГС», а так и осталась ЛОЛ-ом. Используется на форумах и в ICQ для выражения «громкого смеха» над сказанным собеседником.\r\n\r\nAFK (англ. away from keyboard, дословно «Не у клавиатуры») — «отошел на минутку». Употребляется в чатах, IRC и прочих айсикьюшечках для обозначения статуса. Как вариант, АФК в латинской раскладке — FAR, а AFK в кириллической — ФАЛ.Азы - первоначальные, простейшие сведения, начала, основы чего-либо.\r\n\r\nDDoS (сокр. от англ. Distributed Denial of Service, Распределённый отказ от обслуживания) — изначально тип сетевой атаки, основанной на небезграничности ресурсов атакуемой службы, к которой организуется масса запросов, с которыми она заведомо не сможет справиться, и будет вынуждена отказать в обслуживании (либо заставить ждать неприемлемо долго), собственно, отсюда и название. Иногда слово применяется к аналогичным ситуациям в оффлайне.', 1585926820),
