INSERT INTO `forum_topic` (`id`, `sub`, `close`, `stick`, `user`, `name`, `text`, `time`) VALUES
(10, 3, '0', '1', 53, 'Приму в клан.', 'Этот топ создан для лидеров, маршалов и генералов!\r\nЗдесь вы можете оставить сообщение о приеме в ваш клан.\r\n\r\n\r\nДля того, чтобы увеличить шансы на вступление в клан, пишите информацию о своём клане по следующей форме:\r\n\r\nЗаявки:\r\n\r\n1. Название клана\r\n2. Уровень клана и процент построек\r\n3. Критерии приёма в клан\r\n\r\nCообщения типа &quot;Ищу клан&quot;, &quot;Примите в клан&quot; и т.д. оставляйте в специальном топе &quot;Ищу клан&quot;.\r\n\r\n\r\n\r\n За нарушение - бан (6+ часов)\r\n Повторное нарушение - бан (12+ часов)\r\n Покупка/продажа, предложения отдать персонажа/клан - бан (2400+ часов)\r\n Игнорирование правила по bb-кодам - бан (6 часов)\r\n Все комментарии не по теме топа удаляются\r\nКаждое следующее нарушение увеличивает время бана вдвое', 1585923554),
(2, 4, '1', '0', 37, 'Обнова', 'Можно ввести получку ресурсов для тех кто в бане.\r\nСделать кнопку *скрыть игрока* ограничить в видимости у себя на устройстве игрока&lt;&lt;&lt;3 полезные функции \r\nМд не нужно будет сидеть очень часто онлайн\r\nИ желающий может скрыть сообшения в любой момент без ограничений\r\n.\r\nМожно сделать чат для забаненных\r\n\r\nДобавить чат игроков для без клуба\r\n\r\nОграничить в создании акков до 3-х', 1585838443),
(4, 4, '0', '0', 71, 'Стоимость ', 'Предлагаю уменьшить стоимость всего на 50-60% ибо улучшиться нормально тем кто не донатит нереально одни умения до 50 левела больше 100к тянут не говоря про вещи,руны,чары', 1585849219),
