(6, 2, '0', '0', 37, '???????`s ??????s(?1)', '[red]??????? ????•••? ????????????? ?•••\r\n???? ?????????????????`s ??????s. ???\r\n\r\n???????Добро пожаловать в Гробницу Фараона!\r\n?Дорогой читатель, мы сами не верим, что нам годик!\r\n\r\n?????Но обо всем по порядку.\r\n?Итак, что же мы из себя представляем?\r\n????Маленькое уютное местечко, где всегда царит дружба, тепло и комфорт.??\r\n\r\n???? ?Тут так же проводятся игры, мафии, лотереи, викторины.\r\n? ?Голова кружится от разнообразия, правда?\r\n\r\n???? ?Главами этого чудесного места являются:\r\n??? ??Леди?\r\n???С просьбой записи писать надо именно главам!\r\n??? Список участников будет добавлен в клуб.\r\n\r\nРебята, Гробница Фараона теперь и в телеграм! чтобы вас добавили в группу, кидайте свой тг в топе. мы обязательно увидим и добавим вас.\r\n??... Согрей свою душу именно с нашей группировкой, ©Pharaoh\'s Robbers. ?\r\n??? ???? ???? ????????? ???\r\n??????????????????? ??????????[/red]', 1585913249),
(7, 3, '0', '1', 53, 'Правила раздела кланы.', 'Данный раздел предназначен для:\r\nСоздания тем о наборе игроков в кланы и поиска клана.\r\n\r\n\r\n\r\nДля поиска игроков кланы могут пользоваться своими топами-визитками, в которых будут самостоятельно следить за порядком и приглашать модератора при наличии нарушений. \r\nВизитки без bb-кодов оформляются и создаются самостоятельно лидерами кланов. Визитки, оформленные bb-кодами высылаются в ЛС\r\nмодератору раздела.\r\nТак вы можете воспользоваться Топом с готовыми оформлениями, скорректировав данные под ваш клан, либо вы можете обратиться за помощью в оформлении в топ &quot;Услуги кодировщиков&quot;.\r\nДля поиска кланов игроки также могут пользоваться этими же топами - и отписываться в них.\r\n\r\n\r\n\r\n\r\n В названии топа должно быть слово Клан, точное название клана без лишних символов, по желанию - уровень клана. Пример: Клан &quot;Администрация ур. 11&quot;\r\n Запрещается в названии топа использовать Капс (капслок, Caps Lock) — написание сообщений в преимущественно верхнем регистре (большая часть фразы написана заглавными буквами). Примеры использования капса, попадающие под данное нарушение: «ПРИВЕТ», «оНлАЙн-иГРа», «вСЕМ ПРИВЕТ».\r\n Запрещается создавать неслучайное многократное повторение тем, от клана может быть создан только один топик!\r\n За несоблюдение этих правил и требований топ будет сразу закрыт модераторами.\r\n В данном разделе разрешено «поднимать» темы путём отправки бессмысленных сообщений (АПать).\r\n Запрещено выпрашивать передачу лидерства в клане как жалостью, так и попытками мошенничества, продажа клана/персонажа, а также обмен клана на игрового персонажа или наоборот', 1585922652),
(8, 3, '0', '1', 53, 'Все о кланах.', 'Клан - один из самых интересных игровых \r\nмоментов. В клане вы можете \r\nзавести новых знакомых и плечом к плечу со своей командой развивать его.\r\n\r\nСоздание клана/вступление в клан:  \r\nСОЗДАНИЕ КЛАНА\r\n\r\n\r\nИтак, вы четко решили для себя, что хотите стать лидером клана и покорить вселенную игры &quot;Разрушители&quot;. Похвально! Но как это сделать?\r\n\r\nНажмите сюда   Cоздать клан\r\n\r\n Стоимость создания клана 1 000 \r\n Максимальное число букв и символов в названии 20\r\n\r\n\r\n\r\nВСТУПЛЕНИЕ В КЛАН\r\n\r\n\r\nЕсли вы не хотите создавать свой клан, то у вас есть возможность вступить в него. Как же это сделать?\r\n\r\n\r\n Способ 1.\r\nНажмите сюда  Хочу в клан\r\nВсе лидеры, маршалы и генералы увидят вас в списке желающих вступить в клан и, если вы подходите им, то они примут вас в свои ряды\r\n\r\n Способ 2.\r\nЗайдите на страницу клана, который вас интересует, и нажмите\r\n &quot;Заявка на вступление в клан&quot;\r\n\r\n Способ 3.\r\nСвяжитесь с лидером, маршалом или генералом клана по почте. Если вы подходите по параметрам, то, скорее всего, вас примут\r\n\r\nЛидерам Кланов:\r\nЛИДЕРАМ КЛАНОВ\r\n\r\n\r\nИнформация для лидеров, маршалов и генералов клана:\r\n\r\n\r\n Не бойтесь выгонять игроков. Иначе они сядут вам на шею!\r\n\r\n Форум клана - Лицо клана. Старайтесь сохранять его в порядке и всячески украшать.\r\n\r\n Не ввязывайтесь в конфликт, вследствие которого потребуется исключение игрока. О вас пойдет плохая слава.\r\n\r\n Будьте доброжелательным и помогайте соклановцам.\r\n\r\n Один из самых важных топов в гостевом форуме - это &quot;Регламент клана&quot;. Именно правила должен прочитать каждый из игроков, желающих вступить в ваш клан.\r\n\r\n Пополняйте клановый форум ИНТЕРЕСНЫМИ форумными играми. Добавляйте топы на разную тематику: обсуждение фильмов, музыки, игр.\r\n\r\n За небольшие провинности старайтесь объяснять игрокам, что так делать не нужно!\r\n\r\n Требуйте соблюдать пополнение казны или они опять таки сядут на шею. В противном случае выгоняйте! Не нужно жалеть!\r\n\r\n Установите четкое количество опыта, которое должно быть добыто за день/неделю. В противном случае выгонять.\r\n\r\n Старайтесь не набирать маленьких в клан. Самые оптимальные параметры это 1500+. Но для исключения максимум 1000+ но никак не 500 или 700.\r\n\r\n Чем меньше в клане игроков, тем больший процент приносимого кланового опыта. Но менее 5 действует понижающий коэффициент КО\r\n\r\nБонусы и строение:\r\nКЛАНОВЫЕ БОНУСЫ\r\n\r\n\r\n Сила клана\r\nОпыт на арене: +n\r\n(где n - это уровень клана х 2)\r\nСеребро на арене: +n\r\n(где n - это уровень клана х 2)\r\nНеобходимо: 1 уровень клана\r\n\r\n\r\n Военная дисциплина\r\n+5% шанс победы на арене\r\nНеобходимо: 5 уровень клана\r\n\r\n\r\n Серьёзные враги\r\n+5% шанс встретить сильного врага с вещью на арене\r\nНеобходимо: 10 уровень клана\r\n\r\n\r\n Опытный оружейник\r\n+5% к прогрессу от разбираемых вещей\r\nНеобходимо: 15 уровень клана\r\n\r\n\r\n Поиск вещей\r\nПоиск вещей +5% шанс выпадения вещи с сюжетного босса\r\nНеобходимо: 20 уровень клана\r\n\r\n\r\n Серебрянная казна\r\n+5% от заработанного серебра на арене дополнительно добавляется в казну клана\r\nНеобходимо: 25 уровень клана\r\n\r\n\r\nВерой и правдой\r\nучастники клана приносят на 5% больше кланового опыта\r\nНеобходимо: 30 уровень клана\r\n\r\n\r\n Богатая добыча\r\nВсе выпадающие в локациях, сражениях и наградах вещи выше на +1 уровень\r\nНеобходимо: 35 уровень клана\r\n\r\n\r\n Богатая добыча\r\n+5% бонус к опыту с земель и замков в Битве за престол и +5% к бонусу награды на Осадах\r\nНеобходимо: 40 уровень клана\r\n\r\n\r\n Тактика\r\n+5% к опыту в Войнах кланов и Турнире кланов\r\nНеобходимо: 45 уровень клана\r\nКЛАНОВЫЕ СТРОЕНИЯ\r\n\r\n\r\n Академия\r\nОбучение в академии увеличивает получаемый клановый опыт от всех участников клана\r\n\r\n Архивы знаний\r\nЧтение рукописей в архивах знаний увеличивает личный опыт участников клана\r\n\r\n Магическая лавка\r\nУсиливает волшебные свойства, увеличивает серебро от Амулета\r\n\r\n Трофейный зал\r\nДаёт дополнительный бонус к параметрам от трофеев\r\n\r\n Оружейная\r\nОружейная комната дает бонус к опыту при разборе вещей\r\n\r\nЦена строений: \r\nЦЕНА СТРОЕНИЙ\r\n\r\n\r\n\r\n1 уровень - 1000 \r\nВремя постройки: 24 часа\r\nУскорение - 1 000 \r\n\r\n2 уровень - 500 000 \r\nВремя постройки: 36 часов\r\nУскорение - 2 000 \r\n\r\n3 уровень - 5 000 \r\nВремя постройки: 48 часов\r\nУскорение - 3 000 \r\n\r\n4 уровень - 5 млн \r\nВремя постройки: 60 часов\r\nУскорение - 4 000 \r\n\r\n5 уровень - 15 000 \r\nВремя постройки: 72 часа\r\nУскорение - 5 000 \r\n\r\n6 уровень - 25 000 000 \r\nВремя постройки: 84 часа\r\nУскорение - 6 000 \r\n\r\n7 уровень – 25 000 \r\nВремя постройки: 96 часов\r\nУскорение - 7 000 \r\n\r\n8 уровень - 50 000 000 \r\nВремя постройки:108 часов\r\nУскорение - 8 000 \r\n\r\n9 уровень - 50 000 \r\nВремя постройки:120 часов\r\nУскорение - 9 000 \r\n\r\n10 уровень – 100 000 000 \r\nВремя постройки:132 часа\r\nУскорение - 10 000 \r\n\r\n11 уровень – 100 000 \r\nВремя постройки:144 часа\r\nУскорение - 11 000 \r\n\r\n12 уровень – 1 000 000 000 \r\nВремя постройки:156 часов\r\nУскорение - 12 000 \r\n\r\n13 уровень – 150 000 \r\nВремя постройки:168 часов\r\nУскорение - 13 000 \r\n\r\n14 уровень – 2 000 000 000 \r\nВремя постройки:180 часов\r\nУскорение - 14 000 \r\n\r\n15 уровень – 200 000 \r\nВремя постройки:192 часа\r\nУскорение - 15 000  \r\n\r\nБОНУСЫ\r\n\r\n\r\nДополнительный бонус 30% активируется за \r\nВремя действия: 30 часов\r\nДает +30% к n% от строения.\r\nЦена:уровень строения * 10 000\r\nПример : строение 1го уровня дает +1%. Вместе с бонусом будет давать 1,3%.\r\n\r\n\r\n\r\nДополнительный бонус 100% активируется за \r\nВремя действия: 30 часов\r\nДает +100% к n% от строения. \r\nЦена:уровень строения * 100\r\nПример : строение 1го уровня дает +1%. Вместе с бонусом будет давать 2%', 1585922941),
(9, 3, '0', '1', 53, 'Ищу Клан', 'В этом топе вы можете разместить свое объявление о желании вступить в клан.\r\n\r\n\r\nДля того, чтобы увеличить шансы на вступление в клан, пишите информацию о своём персонаже по следующей форме:\r\n\r\nЗаявки:\r\n\r\n1. Уровень клана, который ищете\r\n2. Активность в игре\r\n3. Статус опыта в игре, л.о. (личный опыт)/сутки\r\n4. Указываем, есть ли возможность покупки золота за деньги\r\n5.  Амулет\r\n6. Параметры\r\n7. Готовность выполнять клановые задания\r\n\r\n\r\n\r\nВнимание!\r\nПисать только тем кто ищет клан.\r\nНабор в клан, посторонняя переписка и комментарии к заявкам других игроков (в том числе предложения вида &quot;Иди к нам&quot; и ответы на них)\r\nзакончатся баном.\r\nздесь ТОЛЬКО заявки,\r\nвсе остальное будьте добры обсуждать в почте или у себя на клановом форуме\r\n\r\n\r\n Сообщения вида &quot;*****&quot;, &quot;&quot; (флуд в спец.топе) - бан (6 часов)\r\n Сообщения о наборе, комментарии к сообщениям, посторонняя переписка (оффтоп) - бан (6 часов)\r\n Целенаправленное нарушение - бан (24 часа)\r\n Наемничество - бан (24+ часов)\r\n Заявки вида &quot;иду Лидером&quot; будут расценены, как попрошайничество - бан (24+ часов)\r\n Заявки вида &quot;... без подарка не отвечу&quot; (попрошайничество) - предупреждение, повторно - бан (24+ часов) \r\n Покупка/продажа, предложения отдать персонажа/клан - бан (24000+ часов)\r\n Игнорирование правила по bb-кодам - бан (6 часов)\r\n Все комментарии не по теме топа удаляются.\r\nКаждое последующие нарушение увеличивает время бана вдвое', 1585923467),
(11, 4, '0', '1', 53, 'Игровые термины.', 'Акка?унт (англ. account - счёт)- учётная запись пользователя в какой либо социальной сети, на форуме или просто на сайте, в которой пользователь сообщает о себе некоторые сведения. Аккаунты используются для идентификации пользователей и персонализации общения в Интернете. При этом, указанная информация обычно не проверяется и может содержать искаженные либо вымышленные личные данные.\r\n Аватар, ава- это картинка, которая отображается в профиле игрока. \r\n\r\n Администратор, ад, админ- человек принимающий непосредственное участие в создании, улучшении игры. Администратор пишет в чате, форуме, почте зелёным цветом.\r\n\r\n Баг (англ. bug) - ошибка в программе, веб-приложении, коде веб-страницы, и т.д., в результате которой элемент работает не так, как задумано автором. По легенде, электронные лампы больших и древних ЭВМ часто перегорали из—за мотыльков, летящих на свет и тепло, и машина выходила из строя.\r\n  \r\n\r\n Бан - мера наказания, которая выдаётся администратором или модератором за нарушение игровых правил.\r\n\r\n Баф - усиление игрока на фиксированное время (временые усиления).\r\n\r\n Бот— 1) не настоящий (не человек)\r\n2) программа робот эмулирующая действия человека\r\n3) аккаунт созданный программой.\r\n\r\n Вирт (виртуально) — через комп, в компе, в инете, онлайн.\r\n\r\n Геймер («game»— игра) — игрок, человек, постоянно играющий в компьютерные игры. Геймеры, зацикливаясь на играх, перестают дальше познавать компьютер, деградируют в компьютерном смысле. Правда, часто геймеры настолько погружаются в игровой мир, что деградируют и во всех остальных смыслах.\r\n\r\n Глюк, глючить— проявлять признаки ошибки, ошибаться. (если повторяется, то это уже баг)\r\n\r\n Гуру — уважаемый человек, опытный мастер.\r\n  \r\n\r\n Дамаг - количество очков здоровья, которое вы сможете отнять у противника, если нанесете ему удар.\r\n\r\n Донат- игрок вкладывающий реальные деньги для развития своего персонажа.\r\n\r\n Дроп- любые предметы, ресурсы или деньги, достающиеся игроку после победы над мобом.\r\n\r\n Игнор— интернет-чатовское сокращение от слова «игнорировать», особый программный порядок отношения к отдельным чатланам, при котором его обращения не проходят.\r\n\r\n Инстант, инст- особая игровая зона с усиленными монстрами.\r\n\r\n Клан - группа людей со сходными интересами, объединенная определенными целями, эти цели обычно направлены на достижение превосходства над другими кланами.\r\n\r\n Ламер (от англ. lamer — хромой)— очень часто путают с чайником, но чайник (см. чайник) это совершенно другое. По одному из определений, ламер — это человек, который думает, что всё знает. При этом ламеры очень ярко пытаются это продемонстрировать, принося при этом некоторые неудобства окружающим. В отличие от чайника, который неопытный, но еще научится, ламер — хромой навсегда. Если, конечно, не поймет, что ему еще учиться и учиться.. Ламер — ругательное слово.\r\n  \r\n\r\n Модера?тор(лат. moderor — умеряю, сдерживаю)— пользователь, имеющий более широкие права по сравнению с обычными пользователями на общественных сетевых ресурсах (чаты, форумы, социальные сети, ит.п.), в частности хотя бы одно из прав:\r\n• право удалять чужие сообщения;\r\n• право редактировать чужие сообщения;\r\n• право удалять страницы пользователей;\r\n• ограничивать пользователей в правах редактирования и просмотра сайта (банить).\r\nТочный перечень полномочий и обязанностей модератора на каждом сайте свой. Чаще всего модератор отвечает за соблюдение пользователями правил сайта.\r\n\r\n Мыло— электронная почта (e-mail).\r\n\r\n ИМХО (In My Humble Opinion или In My Honest Opinion) — личное мнение. Трава может быть и красной ИМХО.\r\n\r\nНик- сокращённо от никнейм (англ. nickname - прозвище, кличка) - произвольное, вымышленное имя пользователя, указываемое им при регистрации на форумах, в чатах, в блогах, в социальных сетях и на других общественных Интернет-ресурсах.\r\n\r\nНуб (сленг, от англ. newbie - новичок)- новичок в какой-либо области, неопытный участник или пользователь сетевых или онлайн-игр, новостных групп, операционных систем или Интернета вообще.\r\n  Торн (») 24 янв 05:32\r\n\r\nСпам (англ. spam)- массовая рассылка коммерческой, политической и иной рекламы или иного вида сообщений (информации) лицам, не дававшим согласие получать эту информацию.\r\n\r\nТроллинг— это опять же один из видов нарушения этики сетевого общения. Пожалуй, что троллинг уже перешагнул формат интернета и этот термин широко используют в повседневной жизни. Что же он означает? По сути, это непреднамеренное или же умышленное подначивание с целью вызвать гнев или спровоцировать конфликт. Тролль — провокатор. Пишущий анонимно сообщения с целью навести кипиш.\r\nПовстречать тролля можно везде, где идет обсуждение (форум, соцсеть, комментарии на сайте и т.п.), но вот выявить их бывает не так уж и легко, ибо он прикидывается обычным рядовым пользователем. Но даже выявив троллинг очень трудно будет удержаться от реакции на его провокации по созданию напряженности в сообществе.\r\nНу, а основной причиной распространения троллинга является анонимность, которая имеет место быть при общении в сети. В реальной же жизни они себя так не ведут в силу вероятной ответной реакции, выраженной уже не словами, а делами.\r\n\r\n Флуд (англ. flood - наводнение)- пустословие, сообщения в интернет-форумах, чатах, социальных сетях и прочих местах Интернет-общения, занимающие (во многих случаях) большие объёмы и не несущие какой-либо новой или полезной информации. Лица, которые распространяют флуд, на интернет-сленге называются флудерами.\r\nФлудить - писать ничего не значащие сообщения, засорять ими места Интернет-общения.\r\n\r\n Чайник— человек плохо разбирающийся в компьютерах. Не стоит путать чайников с ламерами.\r\nЧайники склонны к обучению, а отличие от ламеров.\r\n  \r\n\r\n Флейм — это слово означает неожиданно возникающий спор (от flame — огонь) или обсуждение чего-то мало имеющего отношения к сабжу.\r\nНапример, двое и более участников общения начинают спор между собой (в просторечии «срач»), который перерастает в ругань и переход на личности (неконтролируемый выплеск эмоций).\r\n\r\n Оффтоп (оффтопик)— этим словом обычно человек пытается обозначить (извиниться), что оставляемое им сообщение не соответствует теме ветки на форуме или поста в блоге (off topic — «не в тему»). Сообщение может быть «вне темы» всего форума или только конкретной его ветки. За офтопик может быть принято и создание новой темы в неподходящем разделе форума. \r\n\r\n Сабж — это слово образовано от subject, а точнее его сокращения subj, которое обозначает предмет или тему беседы, которая ведется на форуме, конференции, блоге, социальной сети или еще каком-то интернет-сообществе.\r\n\r\n Ржунимагу — смех до потери пульса. Обычно пишут в ответ на глупое высказывание.\r\n\r\n IP — основной протокол передачи данных. Ваш адрес в интернете, как дом, улица, квартира.\r\n\r\n ID — идентификатор пользователя, перед числовым значением.\r\n\r\n Левел, лвл, lvl, ап – уровень персонажа/ ордена в игре.\r\n\r\n Личка, Личная Почта, лс, лп- внутри игровая почтовая система.\r\n\r\n Up, ап - вверх, поднять тему на первые строчки в списке тем форума.', 1585924913),
(12, 4, '0', '1', 53, 'Игровые предложения.', 'Топ создан для ваших предложений по улучшению игры.\r\n\r\n\r\nОт одного автора - один пост. Хорошо подумайте, просмотрите нет ли такого предложения в топе,а потом добавляйте.\r\n\r\n\r\nНе забывайте, что игра рассчитана в первую очередь для мобильных устройств и такие предложения как 3D и звуки будут сразу удаляться!\r\n\r\nПодача:\r\nЧётко и грамотно написать ваше предложение.\r\nКоротко пояснить чем это улучшит игру.\r\n\r\n\r\nВ этом топе флудить, комментировать, писать недовольства и прочее запрещено.\r\nЛюбое сообщение не несущее предложение будет рассматриваться как флуд, и караться баном от 6 часов. При повторном нарушении время удваивается.\r\n\r\n\r\nРаз в неделю топ будет чиститься от идей. Те что после чистки останутся пойдут на рассмотрение администрации', 1585925247),
(13, 4, '0', '1', 53, 'Правила раздела предложений!', 'Данный раздел предназначен для внесения предложений по развитию игры.\r\n\r\n\r\n\r\n\r\n1. В данном разделе темы создаются только с предложениями для улучшения игры.\r\n\r\n2. Создавать темы характера &quot;ищу друзей или клан&quot; - запрещено. для этого есть иные разделы форума.\r\n\r\n3. Клонирование предложений, создание повторяющихся предложений для игры, которые уже есть в этом разделе запрещено.\r\n\r\n4. Офф топ - дословно (сообщения не по теме) так же запрещен \r\n\r\n5. Название созданной темы, должно четко отображать суть топа \r\n\r\n6. Так же, запрещены нецензурные названия, несущие в себе оскорбительный или провокационный характер.\r\n\r\n7. В шапке темы автор обязан изложить тему максимально точно и детально, как того он хочет предложить \r\n\r\n8. Если повторная тема будет хорошо расписана, она не будет закрыта на усмотрение модератора. \r\n\r\n9. Размещение постов не несущих смысловой нагрузки(флуд). Если вы ставите &quot;+&quot; или &quot;-&quot; автору, обязательно поясните что вам нравится, или что вас не устраивает в его предложении. \r\n\r\n10. Запрещается в название топа, а так же в самом топе использовать Капс (капслок, Caps Lock) — написание сообщений в преимущественно верхнем регистре (большая часть фразы написана заглавными буквами). Примеры использования капса, попадающие под данное нарушение: «ПРИВЕТ», «оНлАЙн-иГРа», «вСЕМ ПРИВЕТ». \r\n\r\n\r\n\r\nЗакрыты сразу будут темы, в которых предлагается:\r\n\r\n1) Обменник, обменивать серебро на золото\r\n\r\n2) Рынок или Аукцион\r\n\r\n3) Какое-либо изменение связанное с кол-во боев на арене\r\n\r\n4) Любая тема будет закрыта, если попадёт на 10 страницу и дальше.\r\n\r\n\r\nСписок закрытых тем может дополняться.\r\n\r\n\r\nМодератор имеет правo:\r\n\r\n- Право удалять сообщения или темы не соответствующие разделу;\r\n- право редактировать чужие темы внеся свои корректировки;\r\n- право закрыть любой топик, если считают, что дальнейшее развитие темы ни к чему кроме ругани не приведет;\r\n- ограничивать пользователей в правах редактирования и просмотра форума (банить).', 1585925430),
(14, 8, '0', '1', 53, 'Форум и чат.', 'Посетителям:\r\n\r\nНа форуме и в чате работают обычные правила вежливости, принятые в обществе. Форум и чат - публичное место. То, что невежливо говорить и делать в публичных местах, запрещено на форуме и чате. \r\nОфициальный язык общения — русский.\r\n\r\nТакже запрещено:\r\nМат, оскорбительные высказывания в адрес других людей, травля людей.\r\nПодстрекательство и провокация ссор, свар, ругани, наездов итп.\r\nБеспредметный флуд, когда человек ПОСТОЯННО отмечается во всех топиках подряд, бессмысленно и не прикольно.\r\nПубликация в постах, аватарах, подписях изображений и текстов с: порно, сценами насилия, садо - мазо и просто картинок, вызывающих сильные отрицательные эмоции.\r\nПропаганда насилия, фашизма, разжигание межнациональной розни.\r\nПропаганда и рассказы о любых наркотиках в любой форме.\r\nСоздание ников, дублирующих уже существующих пользователей (То есть когда пользователь создает аккаунт с ником, похожим на аккаунт другого пользователя).\r\nСоздание ников с именами или с намеком на знаменитых и широко известных людей, ников с матерными или просто грубыми словами или намеками на грубые слова.\r\nСоздание несколько аккаунтов для торговли в трейд-разделах.\r\nЗапрещена публикация реферал-ссылок.\r\nЗапрещена публикация материалов и линков связанных с кряками, варезом, ботами, эксплойтами и прочим, что может быть отнесено к нечестной игре или нарушению прав игроков и разработчиков/издателей игр и иного софта, или нарушает существующее законодательство.\r\nКоммерческая реклама и действия, противоречащие интересам разработчиков, администрации и рекламодателей.\r\nНекропостинг (поднятие очень старых тем) не приветствуется. Бессмысленный некропостинг сразу нескольких тем - запрещен. Категорически запрещен некропостинг в новостных разделах. Поднятие старой темы с целью задать осмысленный вопрос по теме обсуждения - разрешено (только для не флудильных тем).\r\nЗапрещено написание сообщений в верхнем регистре букв (капсом)\r\n\r\nВ случае нарушения применяется система предупреждений и банов. \r\n\r\nЕсли забаненый посетитель создает новый аккаунт, он (новый аккаунт) может быть забанен без предупреждений, и все посты с нового аккаунта могут быть удалены. \r\n\r\nПро модераторов: \r\nЗа порядком на форуме следит администрация и модераторы. \r\n\r\nЗапрещается:\r\nПублично обсуждать действия модераторов и/или администрации; спорить с модератором в теме. Примечание: Если модератор участвует в дискуссии наравне со всеми посетителями, то спорить и дискутировать с ним в данной теме можно.\r\nПрямо или завуалированно оскорблять модераторов;\r\nОбсуждать действия временно отключенных (забаненных) участников, которые в данный момент не могут ответить;\r\nПомещать сообщения от имени забаненных.\r\n\r\nЕсли вы недовольны действиями модераторов - пишите сообщение в тех.поддержку \r\n\r\nМодераторы не имеют право:\r\nМодерировать темы в которых они сами принимают участие в дискуссии. Пояснение: Речь идет о &quot;горячих&quot; темах, в которых модератор выступил на той или иной стороне.\r\nВмешиваться в жизнь кланов (клановые форумы), без разрешения на то лидера клана.\r\n\r\n\r\nМодераторы имеют право:\r\nЗакрыть любой топик, если считают, что дальнейшее развитие темы ни к чему кроме ругани не приведет;\r\nВыносить предупреждения пользователям, не соблюдающим правила форума; банить пользователей, которым недостаточно предупреждений.\r\n\r\nРепорты о нарушениях \r\nМодераторы не обязаны отвечать на все репорты о нарушениях. Если модератор не отреагировал на репорт, значит он считает, что его вмешательство не требуется.', 1585925853),
(25, 2, '0', '0', 17, 'Красивые Стихи', 'Тут вы можете писать свои любимые стихи, про любовь, признания в любви, это романтик топ', 1585938776),
