(17, 2, '0', '1', 53, 'Вопрос, Ответ.', 'В этой теме вы можете задать вопрос по игре. Если у вас что то не получается, напишите здесь и вам помогут.\r\nПрежде чем задать вопрос, ознакомьтесь с\r\n\r\nТоп-гид раздела помощь\r\n\r\nСловарь для новичков\r\n\r\nИнформация о драконах\r\n\r\nВсе сообщения не относящиеся к теме будут удалены без предупреждения, нарушители - забанены\r\n\r\n\r\nЕсли вы увидели, что топ закончился - напишите модераторам данного раздела, а не создавайте свои топы\r\n\r\n\r\n\r\n\r\nИнформация о драконах:\r\nСОКРОВИЩА ДРАКОНОВ\r\n\r\n\r\n\r\n\r\nНаходясь в клане, вы можете разорить одну из сокровищниц. Но помните - все сокровищницы охраняются драконами. Открыть портал к драконам можно только 2 раза в неделю. В битве с драконом за сокровища могут участвовать члены клана, находящиеся в нем более 7 дней.\r\n\r\nНа убийство дракона даётся 30 часов\r\n(За убийство дракона менее чем за 10 часов награда будет удвоена)\r\n\r\n\r\nПещера дракона\r\n(Охраняет зелёный дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 75 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры:1 200  100 000  2 500.\r\nНаграда клану: 100 , 10 000  и 10 000 \r\nНаграда игроку: Золото и серебро в зависимости от участия. Редкая или эпическая вещь. 100  добившему.\r\n\r\n\r\n\r\nКазна гномов\r\n(Охраняет синий дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 125 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры: 2 200  270 000  8 500\r\nНаграда клану: 500 , 500 000  и 500 000 \r\nНаграда игроку: Золото и серебро в зависимости от участия. Две вещи редкого или эпического качества. Уровень и качество вещи - рандомно и не зависит от количества нанесенного урона. Игрок, нанесший больше всего урона получает легендарную вещь. 200  добившему.\r\n\r\n\r\n\r\nСокровищница королей\r\n(Охраняет красный дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 175 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры:4 100  1 000 000 18 000.\r\nНаграда клану: 2 000 ,10 000 000 и 2 000 000 \r\nНаграда игроку: Золото и серебро в зависимости от участия. 1 Легендарная вещь (разного уровня прокачки). 500  добившему. 2 мифрила  - 1 нанесшему максимальный урон и 1 случайный.\r\n\r\n\r\n\r\nСокровищница Богов\r\n(Охраняет чёрный дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 250 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры:7 500  3 000 000 25 000.\r\nНаграда клану: 6 000 , 30 000 000  и 6 000 000 \r\nНаграда игроку: Золото и серебро в зависимости от участия. 1 Легендарная вещь (разного уровня прокачки). 1500  добившему. 4 мифрила  - 1 нанесшему максимальный урон а остальные распределяются случайно среди тех, кто нанес минимальную сумму необходимого урона.\r\n\r\n\r\nЗолотая пещера\r\n(Охраняет золотой дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 300 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры:12 000  6 000 000 35 000.\r\nНаграда клану: 15 000 , 90 000 000 и 40 000 000\r\nНаграда игроку: Золото и серебро в зависимости от участия. 1 Легендарная вещь (разного уровня прокачки). Игрок, нанесший больше всего урона получает 2 мифрила, а остальные 8 распределяются случайно среди тех, кто нанес минимальную сумму необходимого урона. 3 000  добившему.\r\n\r\n\r\nБриллиантовая пещера\r\n(Охраняет белый дракон)\r\n\r\n\r\n\r\nСтоимость открытия портала 350 \r\n(Открыть портал могут лидер или маршал)\r\nПараметры:25 000  15 000 000  50 000.\r\nНаграда клану: 35 000 , 225 000 000 и 100 000 000\r\nНаграда игроку: Золото и серебро в зависимости от участия. 1 Легендарная вещь (разного уровня прокачки). Игрок, нанесший больше всего урона получает 3 мифрила, еще 12 случайных игроков получают по мифрилу, при условии, что было нанесено минимум 80 тысяч урона. 6 000  добившему.', 1585926766),
(18, 2, '0', '0', 3, 'Легенда о ПолуночноМодераторе', 'История не моя....тупо сплагиатила т.к познавательная\r\nУвидел в чате. Может ведь быть\r\nеще и похуже. Вы слышали когда-\r\nнибудь про Полуночного\r\nМодератора? Нет? Тогда я расскажу\r\nвам эту грустную и\r\nнемного.жутковатую историю. А вы\r\nзапомните ее и вспоминайте,\r\nглядя ночью слегка\r\nпокрасневшими от недосыпа и\r\nзадротства глазами в экран своего\r\nдевайса.... Итак,\r\nЖил-был на одном ресурсе\r\nмодератор. Был он честен,\r\nбеспристрастен, обьективен и\r\nдобр. Он всегда помогал\r\nнубасикам, отвечая на все их\r\nвопросы, порой, замечу,\r\nдовольно-таки раздражающие и\r\nбестолковые. Он всегда\r\nруководствовался только\r\nправилами, применяя их по\r\nсправедливости, а не жал кнопку\r\nбана из-за личных симпатий и\r\nантипатий. И он терпеть не мог\r\nвыдавать молчи и блоки! Он\r\nвсегда уговаривал и\r\nпредупреждал до последнего, а\r\nесли тролли и скандалисты все-\r\nтаки не унимались, то, когда он\r\nвыдавал им молчи и блоки, его\r\nдобрейшая модераторская душа\r\nобливалась (да, у суровых\r\nмодераторов тоже есть душа,\r\nнередко нежная и трепетная!)\r\nкровью от жалости. В общем, это\r\nбыл идеальный модератор, все\r\nигроки любили и уважали. Нынче\r\nтаких уж нн сыщешь.\r\nИ вот однажды в чате разгорелся\r\nсрач. Тролли и флудеры ругались\r\nматом, сыпали оскорблениями,\r\nфлудом и капсом, и - чего уж греха\r\nтаить ! - многие игроки не\r\nпреминули принять участие в этом\r\nбезобразии. Наш модер просил.\r\nОбьяснял. Предупреждал. Но никто\r\nего не слушал, все сцепились в\r\nбессмысленном буйном сраче.\r\nИ тогда модератор впервые в\r\nжизни рассердился. И заблочил\r\nвсех. А поскольку он был добрым,\r\nего золотое модераторское\r\nсердце, не выдержав такого горя,\r\nровно в полночь остановилось\r\nпрямо за экраном компа.\r\nА что же было дальше, спросите\r\nвы?...\r\nОт горя и обиды на черную\r\nнеблагодарность игроков он не\r\nушел в уютный модераторский\r\nрай, куда, вне всякого сомнения,\r\nпопадают все праведные мд. Он\r\nтак и остался бродить среди\r\nпикселей и мегабайтов на\r\nпросторах интернета.\r\nИ вот теперь злостные тролли и\r\nхамы, обижая по ночам мирных и\r\nчестных юзеров, рискуют увидеть\r\nна внезапно потемневшем экране\r\nисполненный праведного гнева\r\nлик Полуночного Модератора, а\r\nзатем холодный голос произносит:\r\n&quot;Это было последнее\r\nпредупреждение!&quot;, после чего\r\nчерная призрачная рука бьет\r\nзлостного нарушителя правил\r\nтяжким банхаммером по\r\nбестолковой макитре. И, говорят,\r\nпарочка особо упрямых троллей\r\nпропала бесследно - ночью, прямо\r\nиз-за компов.....\r\nP.s...не описайтесь тролли)))', 1585927470),
(19, 2, '0', '0', 3, 'Очень Толковый Словарик)', '1. Брелок — это то, что\r\nпозволяет потерять все ключи\r\noдновременно.\r\n2. Бюджет — это математическое\r\nподтверждение подозрений.\r\n3. Вегетарианство — это\r\nобъедание животных.\r\n4. Вежливость — это не только\r\nпослать, но и пpоводить.\r\n5. Всё — это когда под поpтpетом\r\nпоявилась втоpая дата.\r\n6. Деление уpана — это фигня по\r\nсpавнению с делением денег.\r\n7. Деньги — то начинают\r\nкончаться, то кончают\r\nначинаться.\r\n8. Дешёвка — это бесплатное за\r\nденьги.\r\n9. Животное — это не такая\r\nскотина как человек.\r\n10. Интеллигент — это человек,\r\nдумающий о людях лучше, чем\r\nони о нём.\r\n11. Коммунизм — это\r\nдоказательство пользы\r\nкапитализма от обpатного.\r\n12. Компьютеp — это наpкотик\r\n(быстpое пpивыкание, частая\r\nломка).\r\n13. Мозг — это оpган, с помощью\r\nкотоpого мы думаем, что мы\r\nдумаем...\r\n14. Молитва — это наглость\r\nдумать, что Бог делает что-то не\r\nтак.\r\n15. Hаёмный pаботник — это тот,\r\nкотоpого всё вpемя наёмывают.\r\n16 Hеописуемость — это баобаб\r\nдля собаки.\r\n17. Огоpод — это почва, на\r\nкотоpой человек становится\r\npаком.\r\n18. Опыт — это то, что\r\nполучаешь, не получив того, что\r\nхотел.\r\n19. Паpеная pепа — это голова\r\nпосле сауны.\r\n20. Плоскопопие — это\r\nпpофессиональное заболевание\r\nпpогpаммистов(сопpовождается\r\nвислопузием).\r\n21. Пpофессионал — это тот же\r\nдилетант, но уже знающий, где\r\nошибётся.\r\n22. Русский язык — это то, что\r\nбез мата пpевpащается в доклад.\r\n23. Сахаp — это то, что пpидаёт\r\nнепpиятный вкус кофе, если его\r\nтуда не положить.\r\n24. Свеpхпpоводимость — это\r\nкогда без напpяжения\r\nпpеодолеваешь сопpотивление.\r\n25. Стpаховой агент — это\r\nчеловек, котоpый желает нам\r\nдобpа после зла.\r\n26. Холостяк — это мужчина,\r\nкотоpому удалось не найти жену.\r\n27. Хотдог — это Жаpпсина...\r\n28. Шекспиpмекспиp — это\r\n(англ.) гогольмоголь.\r\n29. Энтеpит — это воспаление\r\nпальца, возникающее пpи\r\nчастом нажатии на клавишу\r\n\'ENTER\'.\r\n30. Чисто прибранная квартира и\r\nвкусный ужин — это два\r\nпризнака неисправного\r\nкомпьютера.\r\n31. Если свет выключается со\r\nзвуком «э-э-э», значит, в туалете\r\nкто-то есть.\r\n32. Cлабый пол... сильнее\r\nсильного в силу слабости\r\nсильного пола к слабому.\r\n33. Весь день не спишь, всю ночь\r\nне ешь, конечно устаешь...!!!\r\n34. Любовь — это состояние\r\nживого организма,\r\nзаставляющее забыть о\r\nсобственной заднице и думать о\r\nчужой.\r\n35. Хотите, чтобы Ваши глаза\r\nбыли большими и\r\nвыразительными?? Тужьтесь!!!\r\n36. Каннибалы тоже считают, что\r\nлюди созданы друг для друга.\r\n37. Настоящие мужчины при\r\nвиде обнаженной женщины не\r\nкраснеют, а бледнеют. Крови для\r\nлица не остается...\r\n38. Если вы белая и пушистая —\r\nвам пора в солярий и на\r\nэпиляцию.\r\n39. Чтобы носки носились в два\r\nраза дольше, надо снимать их на\r\nночь!\r\n40. Если на женщине надета\r\nкороткая юбка — то уже не\r\nважно, как она накрашена... )', 1585928176),
(20, 2, '0', '0', 3, 'Составь свое Имя', 'A: любишь выпить\r\nБ: тебя все хотят\r\nВ: ты больной(ая) на голову\r\nГ: любишь выпить\r\nД: офигенски целуешься\r\nЕ: обалденно сексуален(льна)\r\nЖ: ты не позволишь другим\r\nговорить, что тебе делать)\r\nЗ: у тебя привлекательная\r\nвнешность и характер\r\nИ : ты великолепен(на) в постели\r\nК: люди тебя обожают\r\nЛ: ты дикий(ая) и сумашедший(ая)\r\nМ: тебя все любят\r\nН: целуешься лучше всех в мире\r\nО: любишь выпить\r\nП: божественно целуешься\r\nP: ты самый(ая) популярный(ая)\r\nсреди своего круга общения\r\nС : очень сумашедшая(ий)\r\nТ: в тебя легко влюбиться\r\nУ: ты верен(на) тем кого любишь\r\nФ: тебе нравится остужать пыл\r\nХ: ты не судишь поверхностно\r\nЦ: у тебя очень своеобразный взгляд\r\nна жизнь\r\nШ : ты не позволяешь говорить, что\r\nтебе делать\r\nЭ : самый(ая) лучший(ая)\r\nвозлюбленный(ая) которого можно\r\nтолько поискать\r\nЮ : всегда готов\r\nЯ: любишь себя.', 1585928405),
(21, 2, '0', '0', 3, 'Караоке Бар', 'Музыка, и только музыка)\r\n\r\nЗдесь игроки могут делиться новостями из сферы музыки, выкладывать тексты любимых песен, и просто делиться впечатлениями о музыки!) Приятного общения меломаны))', 1585928664),
